export default (function(a,b,c,d){return {data:{bToBlmDwXm:{data:{id:1225,attributes:{imdbId:"tt0065775",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYTc3ZWU0ZjQtMTQ2MC00OTJhLTkzN2EtYTMyYTNjZGVhM2EwXkEyXkFqcGdeQXVyMTQ3Njg3MQ@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.3\u002F10"},{Source:"Rotten Tomatoes",Value:"25%"},{Source:"Metacritic",Value:"58\u002F100"}],item_lang:{data:{id:1888,attributes:{title:b,plot:"Harry Bailey has returned from Vietnam and returns to college to earn his masters degree so he can teach English. He is considered a hero among the radical student body, but still sees the absurdity on both sides of the fence. He contends with the reactionary administration and the impetuous, often futile objectives of the restless students. He acts as a mediator between the two feuding bodies. On top of everything else, his girlfriend Jan wants to marry him and live a life in the suburbs. He is cornered and finally lets loose at his own masters degree dissertation meeting, just as the latest protest heats up.",slug:"getting-straight"}}},books:{data:[{id:6779,attributes:{title:b,description:a,thumbnail:a,authors:[c],firstBook:true,published:"1968-01-01",publisher:"Bantam Books",subtitle:a}},{id:6780,attributes:{title:b,description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=eKkOAQAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"1967-01-01",publisher:a,subtitle:a}},{id:6781,attributes:{title:"Finding Your Element",description:"The New York Times bestselling author of The Element gives readers an inspirational and practical guide to self-improvement, happiness, creativity, and personal transformation Sir Ken Robinson’s TED talk video and groundbreaking book, The Element, introduced readers to a new concept of self-fulfillment through the convergence of natural talents and personal passions. The Element has inspired readers all over the world and has created for Robinson an intensely devoted following. Now comes the long-awaited companion, the practical guide that helps people find their own Element. Among the questions that this new book answers are: • How do I find out what my talents and passions are? • What if I love something I’m not good at? • What if I’m good at something I don’t love? • What if I can’t make a living from my Element? • How do I do help my children find their Element? Finding Your Element comes at a critical time as concerns about the economy, education and the environment continue to grow. The need to connect to our personal talents and passions has never been greater. As Robinson writes in his introduction, wherever you are, whatever you do, and no matter how old you are, if you’re searching for your Element, this book is for you.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Mq5vZDmsZ1MC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Sir Ken Robinson, PhD","Lou Aronica"],firstBook:d,published:"2013-05-21",publisher:"Penguin",subtitle:"How to Discover Your Talents and Passions and Transform Your Life"}}]}}},meta:{}}},prerenderedAt:1680940977029}}("","Getting Straight","Ken Kolb",null))